import { useState, useEffect } from "react";


const Contact = () => {

  const [isChecked, setIschecked] = useState<boolean>(true);

  const isOutofOrder = (e) =>{
    console.log('is checked');
  }
  const handleCheckboxChange = (event) => {
    setIsChecked(event.target.checked);
  };

  return(
    <>
      <p>Here's how you can contact me:</p>
      <div>
      <h3>Control Panel</h3>
      <div>
        <input onChange={isOutofOrder} type="checkbox" id="sheets-status" />
        <span id="sheets-station" style={{ backgroundColor: isChecked ? "blue" : "red"}} >SHEETS</span>
      </div>
      <div> 
        <input type="checkbox" id="beams-status" /> 
      <span id="beams-station" style={{ backgroundColor: isChecked ? "blue" : "red"}} >BEAMS</span>
      </div>
      <div> 
        <input type="checkbox" id="bolts-status" />
        <span id="bolts-station" style={{ backgroundColor: isChecked ? "blue" : "red"}}>BOLTS</span>
      </div>
      <div> 
        <input type="checkbox" id="frames-status" />
        <span id="frames-station" style={{ backgroundColor: isChecked ? "blue" : "red"}} >FRAMES</span>
      </div>
    </div>
    </>

  );
}

export default Contact;
